/* Common rules
----------------------------------------------- */

@-moz-document url-prefix(http://www.google.co.uk/) {

body {
	background: #253960 url("data:image/png;base64,") top left repeat-x !important;
	color: #FFF !important;
	font-family: Tahoma, Arial, Helvetica, sans-serif !important;
	margin: 1em 1.3em !important;
}

/* defaults for all links */
a:link { color: #82BDFF !important; }
a:visited { color: #72ADDF !important; }
a:active { color: #92CDFF !important; }

/* change color of lots of text (google loves the deprecated font tag) */
font { color: #FFF !important; }

/* Box that pops up when you click the "more >>" link */
span#more { background: #374e7c !important; }

/* "New!" text */
sup font[color="red"] { color: #0F0 !important; }

}


